import React from 'react';

import { Dashboard } from './Components/Dashboard/Dashboard';
import { Navigation } from './Components/Navigation';

function App() {
  return (
    <div className="row">

      <div className="col-2">
        <Navigation/>
      </div>

      <div className="col-10">
        <Dashboard />
      </div>

    </div>
  );
}

export default App;
